$parseMonth = function($date){
    if (!$date) return $date;
    $date =  trim(preg_replace('/ {2,}/',' ', $date));
    if (strpos($date, 'янв') !== false) $month = '01';
    elseif (strpos($date, 'фев') !== false) $month = '02';
    elseif (strpos($date, 'мар') !== false) $month = '03';
    elseif (strpos($date, 'апр') !== false) $month = '04';
    elseif (strpos($date, 'ма') !== false) $month = '05';
    elseif (strpos($date, 'июн') !== false) $month = '06';
    elseif (strpos($date, 'июл') !== false) $month = '07';
    elseif (strpos($date, 'авг') !== false) $month = '08';
    elseif (strpos($date, 'сент') !== false) $month = '09';
    elseif (strpos($date, 'окт') !== false) $month = '10';
    elseif (strpos($date, 'ноя') !== false) $month = '11';
    elseif (strpos($date, 'дек') !== false) $month = '12';
    $year = explode(' ', $date)[1];
    $year = strlen($year) === 2 ? ('20' . $year) : $year; 
    return \Carbon\Carbon::parse($year . '-' . $month . '-01')->endOfMonth();
};

$parseQuarter = function($date){
    if (!$date) return $date;
    $date =  preg_replace('/ {2,}/',' ', $date);
    $values = explode(' ', $date);
    $year = strlen($values[2]) === 2 ? ('20' . $values[2]) : $values[2];
    $month = $values[0] * 3;
    return \Carbon\Carbon::parse($year . '-' . $month . '-01')->endOfMonth();
};

$parseQuarterByMonth = function($date){
    if (!$date) return $date;
    $date =  preg_replace('/ {2,}/',' ', $date);
    $values = explode(' ', $date);
    $year = strlen($values[2]) === 2 ? ('20' . $values[2]) : $values[2];
    $month = $values[0];
    return \Carbon\Carbon::parse($year . '-' . $month . '-01')->endOfMonth();
};

$findDate = function($string, \Carbon\Carbon $maxDate) use ($parseMonth, $parseQuarter, $parseQuarterByMonth) {
  $string = mb_strtolower($string);
  $result1 = [];
  $result2 = [];
  $result3 = [];
  $result4 = [];
  preg_match_all('/[0-9]{2}\.{1}[0-9]{2}\.{1}[0-9]{2,4}/i', $string, $result1);
  preg_match_all('/.?(янв(?:аря|арь)?|фев(?:раля|раль)?|мар(?:та|т)?|апр(?:еля|ель)?|ма(?:й|я)?|июн(?:я|ь)?|июл(?:я|ь)?|авг(?:уста|уст)?|сен(?:тября|тябрь)?|окт(?:ября|ябрь)?|ноя(?:бря|брь)?|дек(?:абря|абрь)?) [0-9]{2,4}/i', $string, $result2);
  preg_match_all('/[1-4]{1}\s{1,}кв(?:артал|\.)?\s{1,}[0-9]{2,4}/i', $string, $result3);
  preg_match_all('/[0-9]{1,2}\s{1,}мес(?:яцев|\.|яца)\s{1,}[0-9]{2,4}/i', $string, $result4);
  return [
    'date' => count($result1[0]) ? date('d.m.Y', (int) collect($result1[0])->reduce(function($accum, $date) use ($maxDate)
        {
            list($day, $month, $year) = explode('.', $date);
            $currentTimestamp = mktime(0, 0, 0, $month, $day, (int) (strlen($year) === 2 ? (int) ('20' . $year) : $year));
            if ($currentTimestamp > $maxDate->timestamp) return $accum;
            return $accum > $currentTimestamp ? $accum : $currentTimestamp;
        }, 0)) : '',
    'string' => $parseMonth(array_shift($result2[0])),
    'quarter' => $parseQuarter(array_shift($result3[0])),
    'month' => $parseQuarterByMonth(array_shift($result4[0])),
  ];
};

