    'documentDate' => \Carbon\Carbon::parse($item['documentDate']),
    'id' => $item['documentNumber'] . '_' . $item['documentDate'],
    'period' => $findDate($item['desc'], \Carbon\Carbon::parse($item['documentDate'])),
  ];
});

$mass->groupBy('id')->each(function($item) {
  if ($item->count() > 1) dump($item);
});

$choosePeriod = function (array $period, $documentDate) {
    if (isset($period['string'])) return $period['string'];
    if (isset($period['quarter'])) return $period['quarter'];
    if (isset($period['month'])) return $period['month'];
    if (isset($period['date'])) return \Carbon\Carbon::parse($period['date']);
    return $documentDate;
};

$mass = $mass->map(function($item) use ($choosePeriod) {
    return [
    'date' => $item['date'],
    'desc' => preg_replace('/((((?:в){0,1}\s{1,}т.ч.)?\s{1,}НДС.{1,})|НДС не облагается.{0,}|(?:Б|б)ез (?:НДС|ндс))/','', $item['desc']),
    'number' => $item['number'],
    'kreditor' => $item['kreditor'],
    'documentNumber' => $item['documentNumber'],
    'documentDate' => $item['documentDate'],
    'id' => $item['id'],
    'period' => $item['period'],
    'debtPeriod' => strpos($item['desc'], 'Комиссия за расчетное обслуживание') !== false ? $item['documentDate']->format('d.m.Y') : $choosePeriod($item['period'], $item['documentDate'])->format('d.m.Y'),
  ];
});

function noise($text) {
  $map = [
    'А' => ['A', 'Å', 'Ä'],
    'а' => ['a', 'å', 'ä'],
    'О' => ['O', 'Ό'],
    'о' => ['o', 'ọ'],
    'Е' => ['E', 'Ė'],
    'е' => ['e', '℮'],
    'В' => ['B', 'ᗷ'],
    'Ж' => ['Җ'],
    'ж' => ['җ'],
    'К' => ['K', 'Ꮶ'],
    'к' => ['k', 'ҝ'],
    'Т' => ['T'],
    'У' => ['Ꭹ'],
    'Ф' => ['Փ'],
    'Н' => ['H'],
  ];
  
  $result = '';
  for ($i = 0; $i < mb_strlen($text); $i++) {
    $word = mb_substr($text, $i, 1);
    $result .= isset($map[$word]) ? (rand(0, 1) ? $map[$word][array_rand($map[$word])] : $word) : $word;
  }
  return $result;
}

echo json_encode($mass, JSON_UNESCAPED_UNICODE);

@endphp
